DROP TABLE dbo.PrimePairs;
DROP TABLE dbo.PrimeTriples;
DROP TABLE dbo.PrimeQuads;

CREATE TABLE dbo.PrimePairs (
	[First] INT NOT NULL,
	[Second] INT NOT NULL,
	CONSTRAINT [FK_PrimePairs] PRIMARY KEY ([First], [Second]),
);

CREATE TABLE dbo.PrimeTriples (
	[First]  INT NOT NULL,
	[Second] INT NOT NULL,
	[Third]  INT NOT NULL,
	CONSTRAINT [FK_PrimeTriples] PRIMARY KEY ([First], [Second], [Third])
);

CREATE TABLE dbo.PrimeQuads (
	[First]   INT NOT NULL,
	[Second]  INT NOT NULL,
	[Third]   INT NOT NULL,
	[Fourth]  INT NOT NULL,
	CONSTRAINT [FK_PrimeQuads] PRIMARY KEY ([First], [Second], [Third], [Fourth])
);


















































































































































































SELECT
	AB.[First] AS [First],
	BC.[First] AS [Second],
	BC.[Second] AS [Third]
FROM dbo.PrimePairs AS AB
JOIN dbo.PrimePairs AS BC ON BC.[First]  = AB.[Second]
JOIN dbo.PrimePairs AS AC ON AC.[First]  = AB.[First]
                         AND AC.[Second] = BC.[Second]

SELECT
	ABC.First,
	ABC.Second,
	ABC.Third,
	ABD.Third AS [Fourth]
FROM dbo.PrimeTriples AS ABC
JOIN dbo.PrimeTriples AS ABD ON ABD.[First] = ABC.[First]
                            AND ABD.[Second] = ABC.[Second]
JOIN dbo.PrimeTriples AS ACD ON ACD.First = ABC.First
                            AND ACD.Second = ABC.Third
                            AND ACD.Third = ABD.Third
JOIN dbo.PrimeTriples AS BCD ON BCD.[First] = ABC.[Second]
                            AND BCD.[Second] = ABC.[Third]
                            AND BCD.Third = ABD.Third;

SELECT
    ABCD.First,
    ABCD.Second,
    ABCD.Third,
    ABCD.Fourth,
    ABCE.Fourth AS [Fifth]
FROM dbo.PrimeQuads AS ABCD
JOIN dbo.PrimeQuads AS ABCE ON ABCE.First = ABCD.First
                           AND ABCE.Second = ABCD.Second
                           AND ABCE.Third = ABCD.Third
JOIN dbo.PrimeQuads AS ABDE ON ABDE.First = ABCD.First
                           AND ABDE.Second = ABCD.Second
                           AND ABDE.Third = ABCD.Fourth
                           AND ABDE.Fourth = ABCE.Fourth
JOIN dbo.PrimeQuads AS ACDE ON ACDE.First = ABCD.First
                           AND ACDE.Second = ABCD.Third
                           AND ACDE.Third = ABCD.Fourth
                           AND ACDE.Fourth = ABCE.Fourth
JOIN dbo.PrimeQuads AS BCDE ON BCDE.First = ABCD.Second
                           AND BCDE.Second = ABCD.Third
                           AND BCDE.Third = ABCD.Fourth
                           AND BCDE.Fourth = ABCE.Fourth;
